void RecvProxy_FlashMaxAlpha(CRecvProxyData *pData, void *pStruct, void *pOut)
{
	
	float *value = &pData->m_Value.m_Float;
	if (Shonax::settingsxd.noflash)
	{
		*value = 0.0f;
	}
	else
	{
		*value = 255.0f;
	}

	//oFlashMaxAlpha(pData, pStruct, pOut);
}
void  __stdcall Hooks::Hooked_FrameStageNotify(ClientFrameStage_t curStage) {

	IClientEntity* m_local = game::localdata.localplayer();

	Vector vecAimPunch;
	Vector vecViewPunch;

	Vector* pAimPunch = nullptr;
	Vector* pViewPunch = nullptr;


	if (m_pEngine->IsConnected() && m_pEngine->IsInGame()) {

		if (curStage == FRAME_RENDER_START) {
			static auto linegoesthrusmoke = game::search.pattern("client_panorama.dll", (PBYTE)"\x55\x8B\xEC\x83\xEC\x08\x8B\x15\x00\x00\x00\x00\x0F\x57\xC0", "xxxxxxxx????xxx");
			static auto smokecout = *(DWORD*)(linegoesthrusmoke + 0x8);

			static std::vector< const char* > smoke_materials = {
				"particle/vistasmokev1/vistasmokev1_smokegrenade",
				"particle/vistasmokev1/vistasmokev1_emods",
				"particle/vistasmokev1/vistasmokev1_emods_impactdust",
				"particle/vistasmokev1/vistasmokev1_fire",
			};
			
			for (auto matName : smoke_materials) {
				IMaterial* mat = m_pMaterialSystem->FindMaterial(matName, "Other textures");
				mat->SetMaterialVarFlag(MATERIAL_VAR_NO_DRAW, Shonax::settingsxd.nosmoketype == 0 && Shonax::settingsxd.nosmoke);
			}

			for (auto matName : smoke_materials) {
				IMaterial* mat = m_pMaterialSystem->FindMaterial(matName, "Other textures");
				mat->SetMaterialVarFlag(MATERIAL_VAR_WIREFRAME, Shonax::settingsxd.nosmoketype == 1 && Shonax::settingsxd.nosmoke);
			}

			if (Shonax::settingsxd.nosmoke) {
				*(int*)(smokecout) = 0;
			}

			if (m_local && m_local->IsAlive()) {
				for (int i = 1; i < m_pGlobals->maxClients; i++) {
					auto ent = m_pEntityList->GetClientEntity(i);
					if (!ent || ent == m_local || ent->GetClientClass()->m_ClassID != (int)CSGOClassID::CCSPlayer || !ent->IsAlive()) continue;


					*(int*)((uintptr_t)ent + 0xA30) = m_pGlobals->framecount;
					*(int*)((uintptr_t)ent + 0xA28) = 0;
				}

				
				if (Shonax::settingsxd.forcethirdperson)
				{
					*(Vector*)((DWORD)m_local + 0x31C8) = Vector(game::globals.visualized_angle.x, game::globals.visualized_angle.y,0.f);
					m_pPrediction->SetLocalViewAngles(game::globals.visualized_angle);
					m_local->UpdateClientSideAnimation();
					m_pPrediction->SetLocalViewAngles(game::globals.fake_angle);
				}
					
				
				if (Shonax::settingsxd.novisrecoil) {
					pAimPunch = m_local->AimPunch();
					pViewPunch = m_local->ViewPunch();

					vecAimPunch = *pAimPunch;
					vecViewPunch = *pViewPunch;

					*pAimPunch = Vector(0, 0, 0);
					*pViewPunch = Vector(0, 0, 0);
				}
			}
		}

		wallmodulator.set_skybox();

		if (curStage == FRAME_NET_UPDATE_POSTDATAUPDATE_START) {


			newskinchanger();
			GloveChanger();
			if (Shonax::settingsxd.legitresolver) resolver.legitresolver();
			
			if (m_local && m_local->IsAlive()) 
			{

				
				if (Shonax::settingsxd.disabieInterpolation) {
					for (int i = 0; i < m_pGlobals->maxClients; i++) {
						auto m_entity = m_pEntityList->GetClientEntity(i);
						if (!m_entity || m_entity == m_local || m_entity->GetClientClass()->m_ClassID != (int)CSGOClassID::CCSPlayer || !m_entity->IsAlive()) continue;

						lagcompensation.disable_interpolation(m_entity);
					}
				}

				resolver.add_corrections();
			}
		}
	}

	g_fnOriginalFrameStageNotify(curStage);

	if (curStage == FRAME_NET_UPDATE_POSTDATAUPDATE_START) {
		backtracking->update(m_pGlobals->tickcount);
	}

	if (Shonax::settingsxd.novisrecoil) {
		if (curStage == ClientFrameStage_t::FRAME_RENDER_START) {
			if (pAimPunch && pViewPunch) {
				*pAimPunch = vecAimPunch;
				*pViewPunch = vecViewPunch;
			}
		}
	}
	/*if (miscconfig.bOtherAimbotDebug)
	{
		static bool debug3 = false;
		if (!debug3)
		{
			ConVar* sv_cheats = m_pCVar->FindVar("sv_cheats");
			SpoofedConvar* sv_cheats_spoofed = new SpoofedConvar(sv_cheats);
			sv_cheats_spoofed->SetInt(1);
			debug3 = true;
		}
	}

	static bool debug3 = false;
	if (miscconfig.bOtherAimbotDebug && m_local->IsAlive())
	{
		if (!debug3)
		{
			m_pEngine->ClientCmd_Unrestricted("net_fakeloss 3");
			m_pEngine->ClientCmd_Unrestricted("net_fakelag 50");
			//m_pEngine->ClientCmd_Unrestricted("net_fakejitter 53535353");
			debug3 = true;
		}
	}
	else if (!miscconfig.bOtherAimbotDebug && m_local->IsAlive())
	{
		debug3 = false;
	}

	static bool debug2 = false;
	if (!miscconfig.bOtherAimbotDebug && m_local->IsAlive())
	{
		if (!debug2)
		{
			m_pEngine->ClientCmd_Unrestricted("net_fakeloss 0");
			m_pEngine->ClientCmd_Unrestricted("net_fakelag 0");
			//m_pEngine->ClientCmd_Unrestricted("net_fakejitter 0");
			debug2 = true;
		}
	}
	else if (miscconfig.bOtherAimbotDebug)
	{
		debug2 = false;
	}*/
}


